DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `summarizeNumberMemory`(IN param_id INT)
BEGIN
  DECLARE n, bins INT;
  DECLARE mean, sd, min, q1, median, q3, max, binStart, binWidth FLOAT;

  SELECT count(*) OVER (),
    avg(max_round) OVER (),
    stddev_samp(max_round) OVER (),
    min(max_round) OVER (),
    percentile_cont(0.25) WITHIN GROUP (ORDER BY max_round) OVER (),
    percentile_cont(0.5) WITHIN GROUP (ORDER BY max_round) OVER (),
    percentile_cont(0.75) WITHIN GROUP (ORDER BY max_round) OVER (),
    max(max_round) OVER ()
  INTO n, mean, sd, min, q1, median, q3, max
  FROM number_memory
  LIMIT 1;

  SET binStart = 0.0,
    binWidth = 1, -- BinWidth of 1, since we're dealing with integer data
    bins = ceil((max - binStart) / binWidth);

  -- Query results
  SELECT n, mean, sd, min, q1, median, q3, max; -- globalStats

  SELECT bins, binStart, binWidth; -- bins

  SELECT floor((max_round - binStart) / binWidth) AS bin, -- histogram
    count(*) / n AS freq
  FROM number_memory
  GROUP BY bin;

  IF ISNULL(param_id) THEN -- query
    SELECT NULL WHERE NULL;
  ELSE
    SELECT id, max_round, quantile
    FROM (SELECT *, percent_rank() OVER (ORDER BY max_round) AS quantile FROM number_memory) AS all_rows
    WHERE id = param_id;
  END IF;
END ;;
