DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `summarizeReactionTime`(IN param_id INT)
BEGIN

  DECLARE n, bins INT;

  DECLARE mean, sd, min, q1, median, q3, max, binStart, binWidth FLOAT;



  DROP TABLE IF EXISTS unpivoted_times;

  CREATE TEMPORARY TABLE unpivoted_times (

    SELECT t,

      percent_rank() OVER (ORDER BY t) AS quantile

    FROM (

      SELECT t1 t

      FROM reaction_time

      UNION ALL

      SELECT t2 t

      FROM reaction_time

      UNION ALL

      SELECT t3 t

      FROM reaction_time

      UNION ALL

      SELECT t4 t

      FROM reaction_time

      UNION ALL

      SELECT t5 t

      FROM reaction_time

    ) AS tab

  );



  SELECT count(*) OVER (),

    avg(t) OVER (),

    stddev_samp(t) OVER (),

    min(t) OVER (),

    percentile_cont(0.25) WITHIN GROUP (ORDER BY t) OVER (),

    percentile_cont(0.5) WITHIN GROUP (ORDER BY t) OVER (),

    percentile_cont(0.75) WITHIN GROUP (ORDER BY t) OVER (),

    max(t) OVER ()

  INTO n, mean, sd, min, q1, median, q3, max

  FROM unpivoted_times

  LIMIT 1;



  SET binStart = 0.0,

    binWidth = round(2 * (q3 - q1) * pow(n, -1.0 / 3.0), 2), 

    bins = ceil((max - binStart) / binWidth);



  

  SELECT n, mean, sd, min, q1, median, q3, max; 



  SELECT bins, binStart, binWidth; 



  SELECT floor((t - binStart) / binWidth) AS bin, 

    count(*) / n AS freq

  FROM unpivoted_times

  GROUP BY bin;



  IF ISNULL(param_id) THEN 

    SELECT NULL WHERE NULL;

  ELSE

    SELECT id,

      t1,

      t2,

      t3,

      t4,

      t5,

      t_sd AS sd,

      t_avg AS mean,

      quantile AS meanQuantile

    FROM unpivoted_times,

      (

        SELECT *

        FROM reaction_time

        WHERE id = param_id

        LIMIT 1

      ) query_row

    WHERE t >= t_avg

    ORDER BY t

    LIMIT 1;

  END IF;

END ;;
DELIMITER ;
