CREATE DEFINER=`root`@`localhost` PROCEDURE `summarizeUser`(IN param_user VARCHAR(256))
BEGIN
  SELECT * from reaction_time where user = param_user;
  SELECT * FROM aim_test_summary WHERE user = param_user;
  SELECT * from number_memory where user = param_user;
END ;;
